import requests from "./request";
import mockRequests from "./request_mock"


export const reqCategoryList = () => {
    return requests({
        url: '/product/getBaseCategoryList',
        method: 'get'
    })
}

export const reqGetBanner = () => mockRequests.get('/banner')
